package com.irrational.test

import com.irrational.Base64Decoder
import kotlinx.coroutines.runBlocking
import org.junit.Test

class Base64Decoder {
    private val imageEncoded = "data:image/png;base64,"

    @Test
    fun testDecode() {
        val image = runBlocking {
            Base64Decoder.decodeImage(imageEncoded.toByteArray())
        }
        assert(image.name.endsWith(".png"))
    }
}